import { Col, DatePicker, Row } from "antd";
import React from "react";
function Dashboard() {
  return (
    <div className="dashboard">
     <Row>
      <Col span={8}>
        <RangePicker />
      </Col>
      <Col span={8}>col-8</Col>
      <Col span={8}>col-8</Col>
    </Row>
    </div>
  );
}
export default Dashboard;
